INSERT INTO `post` VALUES ('227', 'Sandwich végétarien', 'sandwich-vegetarien', '\n\n![](http://www.maredsousfromages.be/wp-content/uploads/2013/04/4.3.3-Sandwich-vegetarien.jpg)\n\n## Ingrédients\n- 1 baguette de pain\n- 8 fines tranches de tomate\n- 8 fines tranches de concombre\n- 4 tranches de fromage\n- 1 avocat *bien mûr*\n- 1 portion de fromage fondu\n- 2 oeufs\n- Quelques feuilles de salade\n\n## Préparation\n### Étape 1\nLaver les tomates et le concombre, puis les couper en tranches avec une mandoline.\nMettre les oeufs à bouillir dans de l\'eau pour une dizaine de minutes afin d\'obtenir des oeufs durs.\n### Étape 2\nÉcraser l\'avocat avec une fourchette, le saler et le poivrer. Incorporer la portion de fromage à cette purée.\n### Étape 3\nCouper la baguette en deux dans la longueur. Les tartiner avec la purée avocat/fromage.\nDécouper les oeufs en tranches de l\'épaisseur de votre choix.\n### Étape 4\nDisposer sur la purée d\'avocat les tranches de légumes et de fromage. Ajouter les tranches d\'oeuf. Finir garnir avec des feuilles de salade.\n### Étape 5\nDéguster!', '2015-12-05 18:23:37'), ('228', 'Sandwich pois-chiches et curry', 'sandwich-pois-chiches-et-curry', '\n\n![](http://image.noelshack.com/fichiers/2015/49/1449225437-curried-chickpea-salad-sandwiches-9249.jpg)\n\n## Ingrédients\n- 2 tranches de pain de campagne\n- 1 boîte de pois-chiches *égouttés et rincés*\n- 2 cuillères à soupe de mayonnaise\n- 2 cuillères à café de curry\n- 1 cuillère à café de moutarde\n- 1/2 oignon émincé **très finement**\n- De la roquette *optionnel*\n\n## Préparation\n### Étape 1\nPréparer la purée de pois-chiches en mettant dans un mixer les pois-chiches, la mayonnaise, la moutarde, le curry et les oignons\n### Étape 2\nFaire griller le pain. Disposer sur la première tranche les feuilles de roquette.\n### Étape 3\nÉtaler généreusement la purée de pois-chiches sur la salade.\n### Étape 4\nDéguster!', '2015-12-07 13:38:00'), ('229', 'Article 1', 'article-1', '# Lorem ipsum\n### dolor sit amet\n\nconsectetur adipiscing elit.\n\n### Mauris porta velit faucibus\n\nlaoreet nibh sit amet, molestie dui. Nulla eu ante lectus. Ut tempus, felis a accumsan mattis, lectus mi lacinia diam, malesuada dictum mi ipsum et mi. Nulla cursus sem tellus, eu tincidunt mauris ornare eu. Mauris ut dui viverra mauris ultrices lacinia. Mauris non ante eleifend, scelerisque nulla vitae, aliquet ligula. Proin dui risus, tristique at tortor ultrices, maximus suscipit magna. Nullam felis magna, laoreet ac mattis sed, feugiat eu mi. Donec ut consectetur sapien, a interdum ipsum. Duis consequat enim non tellus laoreet ornare. Nullam et tristique risus, iaculis semper nibh.', '2015-10-25 10:03:01'), ('230', 'Article 2', 'article-2', '# Lorem ipsum\n### dolor sit amet\n\nconsectetur adipiscing elit.\n\n### Mauris porta velit faucibus\n\nlaoreet nibh sit amet, molestie dui. Nulla eu ante lectus. Ut tempus, felis a accumsan mattis, lectus mi lacinia diam, malesuada dictum mi ipsum et mi. Nulla cursus sem tellus, eu tincidunt mauris ornare eu. Mauris ut dui viverra mauris ultrices lacinia. Mauris non ante eleifend, scelerisque nulla vitae, aliquet ligula. Proin dui risus, tristique at tortor ultrices, maximus suscipit magna. Nullam felis magna, laoreet ac mattis sed, feugiat eu mi. Donec ut consectetur sapien, a interdum ipsum. Duis consequat enim non tellus laoreet ornare. Nullam et tristique risus, iaculis semper nibh.', '2015-10-25 10:03:02'), ('231', 'Article 3', 'article-3', '# Lorem ipsum\n### dolor sit amet\n\nconsectetur adipiscing elit.\n\n### Mauris porta velit faucibus\n\nlaoreet nibh sit amet, molestie dui. Nulla eu ante lectus. Ut tempus, felis a accumsan mattis, lectus mi lacinia diam, malesuada dictum mi ipsum et mi. Nulla cursus sem tellus, eu tincidunt mauris ornare eu. Mauris ut dui viverra mauris ultrices lacinia. Mauris non ante eleifend, scelerisque nulla vitae, aliquet ligula. Proin dui risus, tristique at tortor ultrices, maximus suscipit magn